import React, { Component } from "react";
import AdminMenu from "../adminmenu/AdminMenu";
import { connect } from "react-redux";
import axios from 'axios';
import "./addblog.css";

export class AddBlog extends Component {


  addBlog = () => {
    axios.post('/api/blog').then()
  }
  render() {
    return (
      <div className="addblog">
        <AdminMenu />
        <form onSubmit={e => e.preventDefault()}>
          <label>Title:</label>
          <input type="text" />
          <label>Body:</label>
          <textarea rows="4" cols="50" name="comment" form="usrform" ref="firstName"></textarea>
          <input type="submit" onClick={this.addBlog}/>
        </form>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    userObj: state
  };
};

export default connect(mapStateToProps)(AddBlog);
